import React from 'react';

const Home = () => {
  return (
    <div style={{ padding: '20px' }}>
      <h1>Тестовая страница</h1>
      <p>Если вы это видите, значит роутинг работает!</p>
      <a href="/test">Перейти на тестовую страницу</a>
    </div>
  );
};

export default Home;
